import "./list.scss";
import {ArrowBackIosNewOutlined} from "@material-ui/icons";

export default function List() {
    return (
        <div className="list">
            <span className="listTittle">Continue to watch</span>
            <div className="wrapper">
                <ArrowBackIosNewOutlined />
            </div>
        </div>
    );
}
